import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Property from 'components/Property';
import heartFill from './assets/heart-fill.svg';
import heartStroke from './assets/heart-stroke.svg';

function App() {
  return (<>

    <Routes>
      <Route path="/" element={<Property />}></Route>
    </Routes>

  </>
  );
}

export default App;
